import React, { Component } from 'react';
import Navbar from "../../navbar";
import Footer from "../../footer";
class donasi extends Component {
    render() {
        return (
            <div>
                <Navbar />
                <h1>Donasi Front</h1>
                <Footer />
            </div>
        );
    }
}

export default donasi;
